import React from 'react';
import "./header.scss";

const menu_bar = () => {
    return (
        <nav className="nav">
          <ul>
              <li><a>
                  <i class="fab fa-facebook"></i>
                  Home
                 </a>
                </li>
          </ul>
        </nav>
    );
};

export default menu_bar;
